const reader = require('xlsx')

//parsing arguments
const testPipelineFileName = process.argv[2];
const masterPipelineFileName = process.argv[3];
const resultPipelineFileName = testPipelineFileName.slice(0,testPipelineFileName.indexOf(".xls"))+'_result.xls';

// Reading files
const file1 = reader.readFile(testPipelineFileName)
const file2 = reader.readFile(masterPipelineFileName)


//Filtering rows based on Status = FAIL
const File1ComponentFailRows = reader.utils.sheet_to_json(file1.Sheets['Component'],{range: 6}).filter((row)=>row.Status === "FAIL");
const File1FuncFailRows = reader.utils.sheet_to_json(file1.Sheets['Functional'],{range: 6}).filter((row)=>row.Status === "FAIL");
const File2ComponentFailRows = reader.utils.sheet_to_json(file2.Sheets['Component'],{range: 6}).filter((row)=>row.Status === "FAIL");
const File2FuncFailRows = reader.utils.sheet_to_json(file2.Sheets['Functional'],{range: 6}).filter((row)=>row.Status === "FAIL");

//Extracting TestCaseName__ExcelName for all failing rows
const File2CompFailTCs = [];
const File2FuncFailTCs = [];

File2ComponentFailRows.forEach((row)=>{
    File2CompFailTCs.push(row.TestCaseName+"__"+row.ExcelName);
})

File2FuncFailRows.forEach((row)=>{
    File2FuncFailTCs.push(row.TestCaseName+"__"+row.ExcelName);
})

//Checking whether a File1 failing test is present in File2 failing tests
const File1ExtraCompFails = File1ComponentFailRows.filter((row)=>!File2CompFailTCs.includes(row.TestCaseName+"__"+row.ExcelName));
const File1ExtraFuncFails = File1FuncFailRows.filter((row)=>!File2FuncFailTCs.includes(row.TestCaseName+"__"+row.ExcelName));

